import React from 'react'
import AddCircleIcon from '@mui/icons-material/AddCircle';
import RemoveCircleIcon from '@mui/icons-material/RemoveCircle';

const Cart = () => {
  return (
   <>
     <div className="count">
               <div className="count_btn">
               <AddCircleIcon/>
              <RemoveCircleIcon/>
               </div>
                <button></button>
               </div>
   </>
  )
}

export default Cart
